import { createBrowserRouter } from 'react-router-dom'
import App from '../App'
import Home from '../pages/Home'
import Login from '../pages/Login'


const router = createBrowserRouter([
    {
        path: "/",
        element: <App/>,
        children: [
            {
                path: "/",
                element: <Home />,
            },
            {
                path: "Login",
                element: <Login />,
            },
            {
                path: "/forgot-password",
                element: <Login />,
            }
        ]
    },
])
export default router
